DROP TABLE IF EXISTS `sys_area`;
CREATE TABLE `sys_area` (
  `RWID` varchar(32) NOT NULL,
  `AREA_CODE` varchar(64) DEFAULT NULL COMMENT '地区编码',
  `AREA_NAME` varchar(64) DEFAULT NULL COMMENT '地区名称',
  `PARENT_AREA_ID` varchar(32) DEFAULT NULL,
