  `modify_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT 'SYS_DICT',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `UK_SYS_DICT_CODE` (`dict_code`) USING HASH
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数据字典信息表';

